        end: new Date(2023, 3, 26)
    },


]




const SailingSchedule = () => {
    return (
        <>
            <SEO title="About Us" />
            <main className="page-wrapper">
                <HeaderOne btnStyle="btn-small" />
                <div style={{height: 1000, margin: "70px"}}>
                    <Calendar 
                        localizer={localizer}
                        events={myEventsList}
                        startAccessor="start"
                        endAccessor="end"
                        step={60}
                        defaultDate={new Date(2023, 3, 1)}
                    />
                </div>
                
            </main>
        </>
    )
}

export default SailingSchedule;
